import React from "react";
import Header from "../components/header";
import styles from "./product.module.css"
import { useState } from "react";

function Product() {
  const [ size, setSize ] = useState(null);

  const sizeOptions = [
    { value: null, name: "옵션 선택" },
    { value: "M", name: "M" },
    { value: "X", name: "X" },
    { value: "XL", name: "XL" },
  ];
  const colorOptions = [
    { value: null, name: "옵션 선택" },
    { value: "화이트", name: "화이트" },
    { value: "블랙", name: "블랙" },
  ];

  const SelectBox = (props) => {
    return (
      <select className={styles.sltBox}>
        {props.options.map((option) => (
          <option
            key={option.value}
            value={option.value}
            onChange={
              setSize(value)
            }
          >
            {option.name}
          </option>
        ))}
      </select>
    );
  };

  return (
    <>
      <Header />
      <div className={styles.productSection}>
        <div className={styles.productImgWrap}>
          <div style={{fontSize:'17px'}}>전체 카테고리 &gt;</div>
          <img src={require('../images/sample.jpg')} alt='sample' />
          
        </div>
        <div className={styles.productInfoWrap}>
          
          <h1 style={{fontSize:'23px', fontWeight:'bold'}}>상품명</h1>
          <hr/>

          <div style={{display:'flex'}}>
            <div className={styles.productInfoTag}>
              <ul>
                <li>&gt; 성별</li>
                <li>&gt; 판매가</li>
                <li>&gt; 배송비</li>
                <li>&gt; 재고</li>
                <li>&gt; 사이즈</li>
                <li>&gt; 색상</li>
              </ul>
            </div>

            <div className={styles.productInfo}>
              <ul>
                <li>ex.남</li>
                <li>ex.12,345원</li>
                <li>ex.12,34원</li>
                <li>ex.7</li>
                <SelectBox options={sizeOptions}></SelectBox><br></br>
                <SelectBox options={colorOptions}></SelectBox>
              </ul>
            </div>
          </div>

          <table>
            <th>상품명</th><th>수량</th><th>가격</th><th></th>
            <tr>
              <td>ex.남성셔츠 {sizeOptions.value}</td>
              <td></td>
              <td>ex.12,345원</td>
              <td><button>삭제</button></td>
            </tr>
          </table>

        </div>  
      </div>
    </>
  )
}
export default Product;
